  null,\n\t\"notes\": \"The Office of General Counsel (OGC) has an ongoing business
  process engineering and business process automation initiative which has helped
  the office reduce administrative labor costs while increasing employee effectiveness.
  Supporting this effort is a system of automated routines accessible through a \"portal'
  interface called \"OGC Dashboard.\" The dashboard helps OGC track work progress,
  legal case load, written work products such as legal briefs and advice, and scheduling
  processes such as employee leave plans (via calendar) and travel compensatory time
  off.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
